    function showPropertiesPaneOnSelection() {
        var currentContext = documenteditor.selection.contextType;
        var isInHeaderFooter = currentContext.indexOf('Header') >= 0 || currentContext.indexOf('Footer') >= 0;
        if (!isInHeaderFooter && !showPropertiesPane) {
            showPropertiesPaneFunc(false);
            documenteditor.focusIn();
            return;
        }
        if (!isInHeaderFooter) {
            if (headerFooterElement.style.display === 'block') {
                showPropertiesPaneFunc(false);
                documenteditor.selection.closeHeaderFooter();
            }
            showHeaderProperties = true;
        } else if (isInHeaderFooter && showHeaderProperties) {
            showPropertiesPane = true;
        }
        if (showPropertiesPane) {
            showPropertiesPaneFunc(true);
            if (isInHeaderFooter && showHeaderProperties) {
                showProperties('headerfooter');
            }
            else {
                if (currentContext.indexOf('Text') >= 0 && currentContext.indexOf('Table') < 0) {
                    showProperties('text');
                }
                else if (currentContext.indexOf('Image') >= 0) {
                    showProperties('image');
                }
                else if (currentContext.indexOf('TableOfContents') >= 0) {
                    showProperties('toc');
                }
                else if (currentContext.indexOf('Table') >= 0) {
                    showProperties('table');
                }
            }
        }
        previousContextInToolbar = documenteditor.selection.contextType;
    }
    function onPropertyPaneClick() {
        if (previousContextInToolbar === 'TableOfContents' && showPropertiesPane) {
            documenteditor.focusIn();
            return;
        }
        else if (tocElement.style.display === 'block' && showPropertiesPane) {
            enableDisablePropertyPaneButton(true);
            showPropertiesPaneOnSelection();
            return;
        }
        if (previousContextInToolbar.indexOf('Header') >= 0 ||
            previousContextInToolbar.indexOf('Footer') >= 0) {
            showHeaderProperties = !showHeaderProperties;
        }
        else {
            showPropertiesPane = !showPropertiesPane;
        }
        enableDisablePropertyPaneButton(showPropertiesPane);
        showPropertiesPaneOnSelection();
        documenteditor.focusIn();
    }
    function updateUndoRedoBtn() {
        var undo = document.getElementById('undo');
        var redo = document.getElementById('redo');
        if (!ej.base.isNullOrUndefined(documenteditor.editorHistory) && documenteditor.editorHistory.canUndo()) {
            toolbar.enableItems(undo.parentElement, true);
        } else {
            toolbar.enableItems(undo.parentElement, false);
        }
        if (!ej.base.isNullOrUndefined(documenteditor.editorHistory) && documenteditor.editorHistory.canRedo()) {
            toolbar.enableItems(redo.parentElement, true);
        } else {
            toolbar.enableItems(redo.parentElement, false);
        }
    }
    function onInsertImage(args) {
        if (navigator.userAgent.match('Chrome') || navigator.userAgent.match('Firefox') || navigator.userAgent.match('Edge') ||
            navigator.userAgent.match('MSIE') || navigator.userAgent.match('.NET')) {
            if (args.target.files[0]) {
                var path = args.target.files[0];
                var reader = new FileReader();
                reader.onload = function (frEvent) {
                    var base64String = frEvent.target.result;
                    var image = document.createElement('img');
                    image.addEventListener('load', function () {
                        documenteditor.editor.insertImage(base64String, image.width, image.height);
                    });
                    image.src = base64String;
                };
                reader.readAsDataURL(path);
            }
        }
        else {
            var image = document.createElement('img');
            image.addEventListener('load', function () {
                documenteditor.editor.insertImage(args.target.value);
            });
            image.src = args.target.value;
        }
    }
