    function createBorderSizeDropdown(iconcss, button) {
        var div = ej.base.createElement('div', { id: 'borderSizeTarget', styles: 'display:none' });
        var ulTag = ej.base.createElement('ul', {
            styles: 'display: block; outline: 0px; width: 120px; height: auto;',
            id: 'borderSizeListMenu'
        });
        div.appendChild(ulTag);
        var noneOption = createDropdownOption(ulTag, 'No Border');
        noneOption.addEventListener('click', function () { onBorderSizeChange('No Border'); });
        var oneOption = createDropdownOption(ulTag, '1px');
        oneOption.addEventListener('click', function () { onBorderSizeChange('1px'); });
        var oneHalfOption = createDropdownOption(ulTag, '1.5px');
        oneHalfOption.addEventListener('click', function () { onBorderSizeChange('1.5px'); });
        var twoOption = createDropdownOption(ulTag, '2px');
        twoOption.addEventListener('click', function () { onBorderSizeChange('2px'); });
        var threeOption = createDropdownOption(ulTag, '3px');
        threeOption.addEventListener('click', function () { onBorderSizeChange('3px'); });
        var fourOption = createDropdownOption(ulTag, '4px');
        fourOption.addEventListener('click', function () { onBorderSizeChange('4px'); });
        var fiveOption = createDropdownOption(ulTag, '5px');
        fiveOption.addEventListener('click', function () { onBorderSizeChange('5px'); });
        var borderOption = {
            target: div,
            iconCss: iconcss,
            cssClass: 'e-de-prop-bordersize',
            content: '1.5px'
        };
        var dropdown = new ej.splitbuttons.DropDownButton(borderOption);
        dropdown.beforeOpen = function () {
            div.style.display = 'block';
            for (var i = 0; i < borderSizeColorElement.length; i++) {
                borderSizeColorElement[i].style.borderBottomColor = borderColor;
            }
        };
        dropdown.beforeClose = function () { div.style.display = 'none'; };
        dropdown.appendTo(button);
        dropdown.element.setAttribute('title', 'Border width');
        return dropdown;
    }
