    function updateSelectedBulletListType(listText, bulletDiv) {
        var obj = bulletDiv.getElementsByTagName('li');
        switch (listText) {
            case '\uf0b7':
                obj.bullet_dot.classList.add('de-list-item-selected');
                break;
            case '\uf06f' + '\u0020':
                obj.bullet_circle.classList.add('de-list-item-selected');
                break;
            case '\uf0a7':
                obj.bullet_square.classList.add('de-list-item-selected');
                break;
            case '\uf076':
                obj.bullet_flower.classList.add('de-list-item-selected');
                break;
            case '\uf0d8':
                obj.bullet_arrow.classList.add('de-list-item-selected');
                break;
            case '\uf0fc':
                obj.bullet_tick.classList.add('de-list-item-selected');
                break;
            default:
                obj.bullet_none.classList.add('de-list-item-selected');
                break;
        }
    }
