    function onSelectionChangeInText(isTable) {
        isCharacterRetrieving = true;
        if (isTable) {
            bold = tableTextPropertiesElement.querySelectorAll('#font_properties_bold')[0];
            italic = tableTextPropertiesElement.querySelectorAll('#font_properties_italic')[0];
            underline = tableTextPropertiesElement.querySelectorAll('#font_properties_underline')[0];
            strikethrough = tableTextPropertiesElement.querySelectorAll('#font_properties_strikethrough')[0];
            subscript = tableTextPropertiesElement.querySelectorAll('#font_properties_subscript')[0];
            superscript = tableTextPropertiesElement.querySelectorAll('#font_properties_superscript')[0];
            fontColorInputElement = tableTextPropertiesElement.querySelectorAll('#font_properties_textColor')[0].ej2_instances[0];
            fontFamily = tableTextPropertiesElement.querySelectorAll('#font_properties_fontFamily')[0].ej2_instances[0];
            fontSize = tableTextPropertiesElement.querySelectorAll('#font_properties_fontSize')[0].ej2_instances[0];
            highlightColorInputElement = tableTextPropertiesElement.querySelectorAll('#font_properties_highlightColor')[0].firstChild;
        } else {
            bold = textElement.querySelectorAll('#font_properties_bold')[0];
            italic = textElement.querySelectorAll('#font_properties_italic')[0];
            underline = textElement.querySelectorAll('#font_properties_underline')[0];
            strikethrough = textElement.querySelectorAll('#font_properties_strikethrough')[0];
            subscript = textElement.querySelectorAll('#font_properties_subscript')[0];
            superscript = textElement.querySelectorAll('#font_properties_superscript')[0];
            fontColorInputElement = textElement.querySelectorAll('#font_properties_textColor')[0].ej2_instances[0];
            fontFamily = textElement.querySelectorAll('#font_properties_fontFamily')[0].ej2_instances[0];
            fontSize = textElement.querySelectorAll('#font_properties_fontSize')[0].ej2_instances[0];
            highlightColorInputElement = textElement.querySelectorAll('#font_properties_highlightColor')[0].firstChild;
        }
        if (documenteditor.selection) {
            if (documenteditor.selection.characterFormat.fontFamily) {
                fontFamily.value = documenteditor.selection.characterFormat.fontFamily;
            }
            else {
                fontFamily.value = '';
            }
            if (documenteditor.selection.characterFormat.fontSize) {
                fontSize.value = documenteditor.selection.characterFormat.fontSize.toString();
            }
            else {
                fontSize.value = '';
            }
            if (documenteditor.selection.characterFormat.bold) {
                if (!bold.classList.contains('e-btn-toggle')) {
                    bold.classList.add('e-btn-toggle');
                }
            }
            else {
                if (bold.classList.contains('e-btn-toggle')) {
                    bold.classList.remove('e-btn-toggle');
                }
            }
            if (documenteditor.selection.characterFormat.italic) {
                if (!italic.classList.contains('e-btn-toggle')) {
                    italic.classList.add('e-btn-toggle');
                }
            }
            else {
                if (italic.classList.contains('e-btn-toggle')) {
                    italic.classList.remove('e-btn-toggle');
                }
            }
            if (documenteditor.selection.characterFormat.underline &&
                documenteditor.selection.characterFormat.underline !== 'None') {
                if (!underline.classList.contains('e-btn-toggle')) {
                    underline.classList.add('e-btn-toggle');
                }
            }
            else {
                if (underline.classList.contains('e-btn-toggle')) {
                    underline.classList.remove('e-btn-toggle');
                }
            }
            if (documenteditor.selection.characterFormat.strikethrough &&
                documenteditor.selection.characterFormat.strikethrough !== 'None') {
                if (!strikethrough.classList.contains('e-btn-toggle')) {
                    strikethrough.classList.add('e-btn-toggle');
                }
            }
            else {
                if (strikethrough.classList.contains('e-btn-toggle')) {
                    strikethrough.classList.remove('e-btn-toggle');
                }
            }
            if (documenteditor.selection.characterFormat.baselineAlignment &&
                documenteditor.selection.characterFormat.baselineAlignment === 'Subscript') {
                if (!subscript.classList.contains('e-btn-toggle')) {
                    subscript.classList.add('e-btn-toggle');
                }
            }
            else {
                if (subscript.classList.contains('e-btn-toggle')) {
                    subscript.classList.remove('e-btn-toggle');
                }
            }
            if (documenteditor.selection.characterFormat.baselineAlignment &&
                documenteditor.selection.characterFormat.baselineAlignment === 'Superscript') {
                if (!superscript.classList.contains('e-btn-toggle')) {
                    superscript.classList.add('e-btn-toggle');
                }
            }
            else {
                if (superscript.classList.contains('e-btn-toggle')) {
                    superscript.classList.remove('e-btn-toggle');
                }
            }
            if (documenteditor.selection.characterFormat.fontColor) {
                fontColorInputElement.value = documenteditor.selection.characterFormat.fontColor;
            }
            if (documenteditor.selection.characterFormat.highlightColor) {
                highlightColorInputElement.style.backgroundColor = appliedHighlightColor;
                applyHighlightColorAsBackground(documenteditor.selection.characterFormat.highlightColor);
            }
        }
    }

